電波をキャッチ！正確な時間に自動修正するソーラーパネル搭載の電波時計です。<br><br>標準時刻電波を受信することにより、日本標準時刻、カレンダー情報を自動補正して表示する、車載用電波時計です。<br> 副電源にソーラーパネルを搭載しているので、日光が当たると優先的にソーラーパネルの電力を消費し、電池の消耗を軽減します。<br><br>40kHz、60kHz自動切換え式なので日本全国どこでも受信可能です。<br>1日4回の自動受信で、時刻表示は常に高精度です。<br><br>液晶表示は、月日、曜日、時、分、受信状況、アラーム設定を表示します。<br>夜間でも見やすいブルーバックライト付き。<br>専用ステーと面ファスナーの2通りの取り付けが可能です。<br><br>■仕様■<br>主電源：電池（CR2032お試し電池付き）<br>副電源：ソーラーパネル<br>受信周波数：40kHz（福島長派局）、60kHz（九州長派局）<br><br>●メーカー品番：W661<br>●メーカー名：セイワ / SEIWA<style type="text/css">
